import React, { Component } from "react";
import { Avatar, Card, Menu} from 'antd';
import { UserOutlined } from '@ant-design/icons';
import './App.css';



class FoodPlan extends Component{

   render() {
    return (

      <div class ="Container">
        <div class ="Left-Side">

          <Avatar size={150} icon={<UserOutlined />} style={{ position:'absolute',backgroundColor: 'white',display: 'flex',alignItems: 'center',justifyContent: 'center',top:'5%'}} />
          <Card style={{ width: 150, position:'absolute',backgroundColor: 'white', top:'25%' }}>
              <p>Name: </p>
              <p>Posts: </p>
              <p>Likes: </p>
          </Card>
          <Menu
            onClick={this.handleClick}
            style={{ position:'absolute',width: 256 ,top:'40%'}}
            defaultSelectedKeys={['1']}
            defaultOpenKeys={['sub1']}
            mode="inline"
          >
            <Menu.ItemGroup key="g1" title="Item 1"/>
            <Menu.ItemGroup key="g2" title="Item 2"/>
            <Menu.ItemGroup key="g2" title="Item 3"/>
          </Menu>
        </div>
        <div class ="Right-Side">
          COOL
          COOL
          COOL
        </div>
      </div>

    );
  }
}
export default FoodPlan;
